import React from 'react';

interface CourseItemProps {
  code: string;
  title: string;
}

const CourseItem: React.FC<CourseItemProps> = ({ code, title }) => {
  return (
    <div className="course-item">
      <span className="course-code">{code}</span>
      <span className="course-title">{title}</span>
    </div>
  );
};

const CourseSidebar: React.FC = () => {
  const courses = [
    { code: 'CS101', title: 'Introduction to Computer Science' },
    { code: 'CS201', title: 'Data Structures & Algorithms' },
    { code: 'CS301', title: 'Operating Systems' },
    { code: 'CS315', title: 'Databases & Information Systems' },
    { code: 'CS420', title: 'Machine Learning Fundamentals' },
    { code: 'CS499', title: 'Capstone Project' },
  ];

  return (
    <div className="sidebar">
      <div>
        <h2 className="sidebar-title">CS Course Catalog</h2>
        <div className="course-list">
          {courses.map((course) => (
            <CourseItem key={course.code} code={course.code} title={course.title} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default CourseSidebar;
